import{_ as o,o as t,c as n,z as e,a as r}from"./chunks/framework.9482e208.js";const w=JSON.parse('{"title":"§ 8.01-685 Entry of decision in lower court; issue of execution thereon.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-685.md","filePath":"vacode/8.01-685.md"}'),a={name:"vacode/8.01-685.md"},i=e("h1",{id:"§-8-01-685-entry-of-decision-in-lower-court-issue-of-execution-thereon",tabindex:"-1"},[r("§ 8.01-685 Entry of decision in lower court; issue of execution thereon. "),e("a",{class:"header-anchor",href:"#§-8-01-685-entry-of-decision-in-lower-court-issue-of-execution-thereon","aria-label":'Permalink to "§ 8.01-685 Entry of decision in lower court; issue of execution thereon."'},"​")],-1),c=e("p",null,"The court or other tribunal from which any case may have come to an appellate court shall enter the decision of the appellate court as its own, and execution or other appropriate process may issue thereon accordingly. When that decision is received by the clerk or secretary of the court or tribunal below, he shall enter it of record in his order book, and thereupon such execution may issue and such proceedings be had in the case as would have been proper if the decision had been entered in court or by such tribunal.",-1),s=e("p",null,"If the judgment of the lower court or tribunal is affirmed, in whole or in part, by the decision of an appellate court, execution or other appropriate process may issue thereon against the principal and surety on any appeal bond which may have been given, for the amount of such judgment, including the interest and cost and the damages awarded by the appellate court, not exceeding, however, the penalty of such bond.",-1),h=e("p",null,"Code 1950, § 8-498; 1977, c. 617; 1984, c. 703.",-1),d=[i,c,s,h];function u(l,p,f,_,m,y){return t(),n("div",null,d)}const x=o(a,[["render",u]]);export{w as __pageData,x as default};
